import React, { PureComponent } from 'react'
import { Redirect, Link } from 'react-router-dom'

export default class Home extends PureComponent {
    handleClick() {
        return <Link to={`/user`} />
      }

    render() {
        return (
            <div>
                <button onClick={this.handleClick}>hello world</button>
            </div>
        )
    }
}
